import React, { useState } from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
  CssBaseline,
  Box,
  Menu,
  MenuItem,
  Button,
  FormControl,
  InputLabel,
  Select,
  SelectChangeEvent,
  MenuItem as MuiMenuItem,
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import PublicIcon from '@mui/icons-material/Public'; // World icon
import { createTheme, ThemeProvider } from '@mui/material/styles';
import '../css/Dashboard.css'; // Import the CSS file

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#000',
      paper: '#121212',
    },
    text: {
      primary: '#fff',
      secondary: '#b0bec5',
    },
  },
  typography: {
    h6: {
      fontSize: '1.25rem',
      fontWeight: 700,
      color: '#fff',
    },
  },
});

const Dashboard = () => {
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [anchorEl, setAnchorEl] = useState(null);
  const [countryMenuAnchorEl, setCountryMenuAnchorEl] = useState(null);
  const [selectedCountry, setSelectedCountry] = useState('');
  const isMenuOpen = Boolean(anchorEl);
  const isCountryMenuOpen = Boolean(countryMenuAnchorEl);
  const username = 'John Doe'; // Example username

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    // Implement logout functionality here
    handleMenuClose();
  };

  const handleCountryMenuOpen = (event) => {
    setCountryMenuAnchorEl(event.currentTarget);
  };

  const handleCountryMenuClose = () => {
    setCountryMenuAnchorEl(null);
  };

  const handleCountryChange = (event: SelectChangeEvent<string>) => {
    setSelectedCountry(event.target.value);
    handleCountryMenuClose();
  };

  const countries = [
    'USA', 'Canada', 'UK', 'Australia', // Add more countries as needed
    'Brazil', 'Germany', 'France', 'Italy', 'Japan', // Example additional countries
  ];

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="fixed" className="appBar">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" onClick={() => setDrawerOpen(!drawerOpen)} className="menuIcon">
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }} className="title">
            Sports Tournament
          </Typography>
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <IconButton
              edge="end"
              color="inherit"
              aria-label="select-country"
              onClick={handleCountryMenuOpen}
              className="countryButton"
            >
              <PublicIcon />
            </IconButton>
            <FormControl variant="outlined" size="small" sx={{ display: 'none' }}>
              <InputLabel htmlFor="country-select">Country</InputLabel>
              <Select
                value={selectedCountry}
                onChange={handleCountryChange}
                label="Country"
                inputProps={{
                  id: 'country-select',
                }}
              >
                {countries.map((country) => (
                  <MuiMenuItem key={country} value={country}>
                    {country}
                  </MuiMenuItem>
                ))}
              </Select>
            </FormControl>
            <Button color="inherit" variant="outlined" className="advertiseButton">
              Advertise Tournament
            </Button>
            <IconButton edge="end" color="inherit" aria-label="profile" onClick={handleMenuOpen} className="profileButton">
              <AccountCircleIcon />
            </IconButton>
            <Typography variant="body1" className="username">
              {username}
            </Typography>
          </Box>
          <Menu
            anchorEl={anchorEl}
            open={isMenuOpen}
            onClose={handleMenuClose}
            PaperProps={{
              sx: {
                backgroundColor: '#0A0A0A',
                color: '#fff',
              },
            }}
          >
            <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
            <MenuItem onClick={handleMenuClose}>My Account</MenuItem>
            <MenuItem onClick={handleLogout}>Logout</MenuItem>
          </Menu>
          <Menu
            anchorEl={countryMenuAnchorEl}
            open={isCountryMenuOpen}
            onClose={handleCountryMenuClose}
            PaperProps={{
              sx: {
                backgroundColor: '#0A0A0A',
                color: '#fff',
              },
            }}
          >
            {countries.map((country) => (
              <MenuItem key={country} onClick={() => { setSelectedCountry(country); handleCountryMenuClose(); }}>
                {country}
              </MenuItem>
            ))}
          </Menu>
        </Toolbar>
      </AppBar>
      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={() => setDrawerOpen(false)}
        PaperProps={{
          sx: {
            backgroundColor: '#0A0A0A',
            color: '#fff',
          },
        }}
        className="drawer"
      >
        <List sx={{ width: 250 }}>
          <ListItem button onClick={() => setDrawerOpen(false)}>
            <ListItemIcon>
              <CloseIcon className="closeIcon" />
            </ListItemIcon>
          </ListItem>
          <ListItem button component="a" href="/home">
            <ListItemText primary="Home" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/about-us">
            <ListItemText primary="About us" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/partner">
            <ListItemText primary="Partner With Us" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/membership-management">
            <ListItemText primary="Membership Management" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/book-now">
            <ListItemText primary="Book Now" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/news-events">
            <ListItemText primary="News and Events" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/careers">
            <ListItemText primary="Careers" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/blogs">
            <ListItemText primary="Blogs" className="listItemText" />
          </ListItem>
        </List>
      </Drawer>
    </ThemeProvider>
  );
};

export default Dashboard;
